import React from 'react';

const BotCard = ({ bot, children }) => {
  return (
    <div className="bot-card">
      <img src={bot.avatar_url} alt={bot.name} />
      <h3>{bot.name}</h3>
      {children}
    </div>
  );
};

export default BotCard;
